import { useEffect, useRef } from "react";
import { APIGet } from "../External/ApiHelper";
export default function CreateWorkout() {
  const PossibleExercises = useRef();
  useEffect(() => {
    APIGet("http://localhost:8000/api/v1/", "exercises", true).then(
      (res) => (PossibleExercises.current = res)
    );
  }, []);
  const HandleAddExercise = function (day) {};
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col-md">
          <h1>Monday</h1>
          <button onClick={() => HandleAddExercise("Monday")}>
            Add exercise
          </button>
        </div>
        <div className="col-md">
          <h1>Tuesday</h1>
        </div>
        <div className="col-md">
          <h1>Wednesday</h1>
        </div>
        <div className="col-md">
          <h1>Thurday</h1>
        </div>
        <div className="col-md">
          <h1>Friday</h1>
        </div>
        <div className="col-md">
          <h1>Saturday</h1>
        </div>
        <div className="col-md">
          <h1>Sunday</h1>
        </div>
      </div>
      <p>{PossibleExercises.current.keys()}</p>
    </div>
  );
}
